import './App.css';
import {
  BrowserRouter,
  Switch,
  Route,
} from "react-router-dom";

import HomePage from './pages/HomePage';

function App() {

  return (
    <Router>
      <Route path="/" component={<HomePage />} />
    </Router>
  );
}

export default App;
